import React from "react";

const Card = ({title = "TitleName", body = "Title Details", btn = "Headover"}) => (
    <div className="card" style={{width: "18rem"}}>
    <img
        src="https://images.pexels.com/photos/3532557/pexels-photo-3532557.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
        className="card-img-top"
        alt="..."
    />
    <div className="card-body">
        <h5 className="card-title">{title}</h5>
        <p className="card-text">{body}</p>
        <a href="#" className="btn btn-success">{btn}</a>
    </div>
    </div>
);

export default Card;
